import React from "react";

const ShowTask = ({ taskList, setTaskList }) => {
  const tasks = [
    { id: 1001, name: "Task B", time: "5:55:01 AM 1/17/2025" },
    { id: 1002, name: "Task C", time: "6:55:01 AM 2/17/2025" },
    { id: 1003, name: "Task D", time: "7:55:01 AM 3/17/2025" },
    { id: 1004, name: "Task E", time: "5:55:01 AM 4/17/2025" },
  ];

  return (
    <section className="showTask">
      <div className="head">
        <div>
          <span className="title">To Do</span>
          <span className="count">0</span>
        </div>

        <button className="clearAll" type="button">
          Clear ALL
        </button>
      </div>
      <ul>
        {tasks.map((task) => (
          <li key={task.id}>
            <p>
              <span className="name">{task.name}</span>
              <span className="time">{task.time}</span>
            </p>
            <i className="bi bi-pencil-square"></i>
            <i className="bi bi-trash"></i>
          </li>
        ))}
      </ul>
    </section>
  );
};

export default ShowTask;
